INSERT INTO `message_template` VALUES (4,'Contact us email','Internal','email','mkopo@inventure.org','Contact us','Question asked: {Question}\r\nName: {Name}\r\nPhone Number: {Phone number}\r\nEmail: {Email}\r\nNote: {Note}','{\"message_type\":\"html\"}','2014-09-12 01:05:38','2014-07-15 13:30:53',771),(5,'Disbursement SMS to Magutah','Internal','sms','21991','','Send {amount} to {customer name} {customer phone}',NULL,'2015-02-10 20:02:45',NULL,6135),(6,'Money Disbursement Email','Communication to borrower - Mkopo Rahisi','email','mkopo@inventure.org','*IMPORTANT Info about your Mkopo Rahisi Loan','<!DOCTYPE html PUBLIC \'-//W3C//DTD XHTML 1.0 Transitional//EN\' \'http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\'>\r\n            <html xmlns=\'http://www.w3.org/1999/xhtml\'>\r\n            <head>\r\n            <meta http-equiv=\'Content-Type\' content=\'text/html; charset=UTF-8\' />\r\n            <title>Welcome to Mkopo Rahisi</title>\r\n            <meta name=\'viewport\' content=\'width=device-width, initial-scale=1.0\'/>\r\n            </head>\r\n            <body style=\'margin: 0; padding: 0;\'>\r\n                <table border=\'0\' cellpadding=\'0\' cellspacing=\'0\' width=\'100%\'>\r\n                    <tr>\r\n                        <td style=\'padding: 10px 0 30px 0;\'>\r\n                            <table align=\'center\' border=\'0\' cellpadding=\'0\' cellspacing=\'0\' width=\'600\' style=\'border: 1px solid #cccccc; border-collapse: collapse;\'>\r\n                                <tr>\r\n                                    <td align=\'left\' bgcolor=\'#FFCC00\' style=\'padding: 20px 0px 20px 30px; color: #153643; font-size: 28px; font-weight: bold; font-family: Arial, sans-serif;\'>\r\n                                        <img src=\'http://safari.inventure.org/assets/images/logo.png\' alt=\'MkopoRahisi\' width=\'100\' height=\'100\' style=\'display: block;\' />\r\n                                    </td>\r\n                                </tr>\r\n                                <tr>\r\n                                    <td bgcolor=\'#FFFFFF\' style=\'padding: 0px 30px 40px 30px;\'>\r\n                                        <table border=\'0\' cellpadding=\'0\' cellspacing=\'0\' width=\'100%\'>\r\n                                            <tr>\r\n                                                <td style=\'padding: 20px 0 30px 0; color: #153643; font-family: Arial, sans-serif; font-size: 14px; line-height: 20px;\'>\r\n\r\n<p>Dear {client_name}</p>\r\n            <p>We are happy to report we have just sent you your <span style=\'font-weight:bold\'>{loan_type amount} ksh Mkopo Rahisi loan</span>. We could not be happier that you\'ve chosen us as your trusted mobile money lender.</p>\r\n            <p>Please review the bullet points below for <span style=\'font-weight:bold\'>important information</span> about your loan.</p>\r\n\r\n            <p><span style=\'font-weight:bold\'>Your Repayment Schedule:</span></p>\r\n            <ul>\r\n                <li><span style=\'font-weight:bold\'> {first date} </span>: Pay {first repayment amount} ksh</li>\r\n                <li><span style=\'font-weight:bold\'> {second date} </span>: Pay {second repayment amount} ksh</li>\r\n                <li><span style=\'font-weight:bold\'> {third date} </span>: Pay {third repayment amount} ksh</li>\r\n                <li>Please send ALL payments to <span style=\'font-weight:bold\'>M-Pesa paybill number 851900.</span> Use your M-Pesa number as your account number.</li>\r\n                <li> The M-Pesa confirmation message may say you have sent money to our partner, “MAMAMIKES ONLINE LTD.” This is OK; you should still receive an additional SMS confirming we have received your payment.</li>\r\n                <li>There is <span style=\'font-weight:bold\'>no penalty for early repayment.</span></li>\r\n                <li>Late payments or defaults will make it <span style=\'font-weight:bold\'>harder for you to qualify for new loans</span> from Mkopo Rahisi or others in the future. </li>\r\n            </ul>\r\n\r\n            <p><span style=\'font-weight:bold\'>The Fine Print</span></p>\r\n            <ul>\r\n                <li>There are no hidden costs or fees.</li>\r\n                <li>Each installment must be paid no later than midnight of the due date. </li>\r\n                <li>We post our <a href=\'http://safari.inventure.org/safari/terms\'>Terms of Service</a> and <a href=\'http://safari.inventure.org/safari/privacy\'>Privacy Policy</a> so they can be reviewed at any time.</li>\r\n            </ul>\r\n\r\n            <p><span style=\'font-weight:bold\'>Remember to send your payments on time to M-Pesa paybill number 851900!</span></p>\r\n            <p>If you have any questions you should message our <a href=\'https://www.facebook.com/mkoporahisi\'> Mkopo Rahisi page</a> on Facebook.</p>\r\n            <p>Best of luck,</p>\r\n            <p><span style=\'font-weight:bold\'>Team Mkopo Rahisi</span></p>\r\n\r\n</td>\r\n                                            </tr>\r\n                                        </table>\r\n                                    </td>\r\n                                </tr>\r\n                                <tr>\r\n                                    <td bgcolor=\'#FFCC00\' style=\'padding: 30px 30px 30px 30px;\'>\r\n                                        <table border=\'0\' cellpadding=\'0\' cellspacing=\'0\' width=\'100%\'>\r\n                                            <tr>\r\n                                                <td align=\'center\' width=\'25%\'>\r\n                                                    <table border=\'0\' cellpadding=\'0\' cellspacing=\'0\'>\r\n                                                        <tr>\r\n                                                            <td align=\'center\' style=\'color: #000000; font-family: Arial, sans-serif; font-size: 12px; font-weight: bold;\'>\r\n                                                                Powered by\r\n                                                            </td>\r\n                                                        </tr>\r\n                                                        <tr>\r\n                                                            <td align=\'center\' style=\'font-family: Arial, sans-serif; font-size: 12px; font-weight: bold;\'>\r\n                                                                <a href=\'http://inventure.org/\' style=\'color: #000000;\'>\r\n                                                                    <img src=\'http://safari.inventure.org/assets/images/inventure_black.png\' alt=\'InVenture\' width=\'100\' height=\'40\' style=\'display: block;\' border=\'0\' />\r\n                                                                </a>\r\n                                                            </td>\r\n                                                        </tr>\r\n                                                    </table>\r\n                                                </td>\r\n                                                <td style=\'color: #000000; font-family: Arial, sans-serif; font-size: 14px;\' width=\'50%\'>\r\n                                                </td>\r\n                                                <td style=\'color: #000000; font-family: Arial, sans-serif; font-size: 12px;\' width=\'25%\'>\r\n                                                    Contact Us:<br>\r\n                                                    mkopo@inventure.org<br>\r\n                                                    Nairobi, Kenya<br>\r\n                                                </td>\r\n                                            </tr>\r\n                                        </table>\r\n                                    </td>\r\n                                </tr>\r\n                            </table>\r\n                        </td>\r\n                    </tr>\r\n                </table>\r\n            </body>\r\n            </html>','{\"message_type\":\"html\"}','2015-02-17 17:44:35',NULL,4913),(7,'Internal No Placeholder','Internal','email','mkopo@inventure.org','','{content}','{\"message_type\":\"html\"}','2014-12-11 00:00:02','2014-07-15 13:31:00',6173),(8,'Welcome to Mkopo Rahisi','Communication to borrower - Mkopo Rahisi','email','mkopo@inventure.org','Welcome to Mkopo Rahisi','<!DOCTYPE html PUBLIC \'-//W3C//DTD XHTML 1.0 Transitional//EN\' \'http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\'>\r\n<html xmlns=\'http://www.w3.org/1999/xhtml\'>\r\n    \r\n    <head>\r\n        <meta http-equiv=\'Content-Type\' content=\'text/html; charset=UTF-8\' />\r\n        <title>Welcome to Mkopo Rahisi</title>\r\n        <meta name=\'viewport\' content=\'width=device-width, initial-scale=1.0\' />\r\n    </head>\r\n    \r\n    <body style=\'margin: 0; padding: 0;\'>\r\n        <table border=\'0\' cellpadding=\'0\' cellspacing=\'0\' width=\'100%\'>\r\n            <tr>\r\n                <td style=\'padding: 10px 0 30px 0;\'>\r\n                    <table align=\'center\' border=\'0\' cellpadding=\'0\' cellspacing=\'0\' width=\'600\' style=\'border: 1px solid #cccccc; border-collapse: collapse;\'>\r\n                        <tr>\r\n                            <td align=\'left\' bgcolor=\'#FFCC00\' style=\'padding: 20px 0px 20px 30px; color: #153643; font-size: 28px; font-weight: bold; font-family: Arial, sans-serif;\'>\r\n                                <img src=\'http://safari.inventure.org/assets/images/logo.png\' alt=\'MkopoRahisi\' width=\'100\' height=\'100\' style=\'display: block;\' />\r\n                            </td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td bgcolor=\'#FFFFFF\' style=\'padding: 0px 30px 40px 30px;\'>\r\n                                <table border=\'0\' cellpadding=\'0\' cellspacing=\'0\' width=\'100%\'>\r\n                                    <tr>\r\n                                        <td style=\'padding: 20px 0 30px 0; color: #153643; font-family: Arial, sans-serif; font-size: 14px; line-height: 20px;\'>\r\n                                            \r\n<h2>Welcome to Mkopo Rahisi, {cleint_name}</h2>\r\n\r\n                                            <p><span style=\'font-weight:bold\'>Congratulations on qualifying for your {loan_amount} ksh {loan_purpose} loan! Here\'s what\'s next: </span>\r\n\r\n                                            </p>\r\n                                            <ul>\r\n                                                <li><span style=\'text-decoration:underline\'>Step 1</span>: Confirm you received the initial amount of the loan by messaging the <a href=\'https://www.facebook.com/mkoporahisi\'>Mkopo Rahisi page</a> on facebook with the amount you received. (example: “Received 49 ksh”)</li>\r\n                                                <li><span style=\'text-decoration:underline\'>Step 2</span>: Like the <a href=\'https://www.facebook.com/mkoporahisi\'>Mkopo Rahisi page</a> on Facebook to get offers and updates from Mkopo Rahisi!</li>\r\n                                                <li><span style=\'text-decoration:underline\'>Step 3</span>: Message our <a href=\'https://www.facebook.com/mkoporahisi\'>Facebook page</a> with any questions you might have.</li>\r\n                                                <li><span style=\'text-decoration:underline\'>Step 4</span>: Get the rest of your loan, and start making your dreams come true!</li>\r\n                                            </ul>\r\n                                            <p><span style=\'font-weight:bold\'>What you <span style=\'text-decoration:underline\'>need</span> to know about our loans</span>\r\n                                            </p>\r\n                                            <ul>\r\n                                                <li>We rely on Facebook messaging for most all conversations. <span style=\'font-weight:bold\'>If you can\'t use Facebook regularly, Mkopo Rahisi is not recommended.</span>\r\n\r\n                                                </li>\r\n                                                <li>We do not currently use <span style=\'font-weight:bold\'>WhatsApp.</span>\r\n\r\n                                                </li>\r\n                                            </ul>\r\n                                            <p><span style=\'font-weight:bold\'>How you <span style=\'text-decoration:underline\'>must</span> repay your loan</span>\r\n                                            </p>\r\n                                            <ul>\r\n                                                <li>You must repay your loan with <span style=\'font-weight:bold\'>3 weekly payments of {repayment_amount}ksh</span> to M-Pesa paybill number <span style=\'font-weight:bold\'>851900</span>. Use your M-Pesa number as your account number. There is a link to more detailed instructions on how to make repayments on the main page in the Mkopo Rahisi app.</li>\r\n                                                <li>Your first payment is due 7 days after you receive your {loan_amount}ksh loan.</li>\r\n                                                    <li>For example, if you received your loan on Jan 1, then your repayment schedule would be:</li>\r\n                                                <ul>\r\n                                                    <li>January 8: Pay {repayment_amount}Ksh</li>\r\n                                                    <li>January 15: Pay {repayment_amount}Ksh</li>\r\n                                                    <li>January 22: Pay {repayment_amount}Ksh</li>\r\n                                                </ul>\r\n                                                <li>There are <span style=\'font-weight:bold\'>no hidden costs or fees.</span>\r\n\r\n                                                </li>\r\n                                                <li>Each installment must be paid <span style=\'font-weight:bold\'>no later than 11:59 PM EAT on the day it is due.</span>\r\n\r\n                                                </li>\r\n                                                <li>There is no penalty for early repayment, but <span style=\'font-weight:bold\'>late payments or defaults will make it harder for you to qualify for new loans from Mkopo Rahisi or others in the future</span>.</li>\r\n                                                <li>You can review our <a href=\'http://safari.inventure.org/safari/terms\'>Terms of Service</a> and <a href=\'http://safari.inventure.org/safari/privacy\'>Privacy Policy</a> from the Mkopo Rahisi app at any time</li>\r\n                                            </ul>\r\n                                            <p><span style=\'font-weight:bold\'>We look forward to having you as a customer!</span>\r\n\r\n                                            </p>\r\n                                            <p><span style=\'font-weight:bold\'></span>Sincerely,</p>\r\n                                            <p><span style=\'font-weight:bold\'></span>Team Mkopo Rahisi</p>\r\n                                        </td>\r\n                                    </tr>\r\n                                </table>\r\n                            </td>\r\n                        </tr>\r\n                        <tr>\r\n                            <td bgcolor=\'#FFCC00\' style=\'padding: 30px 30px 30px 30px;\'>\r\n                                <table border=\'0\' cellpadding=\'0\' cellspacing=\'0\' width=\'100%\'>\r\n                                    <tr>\r\n                                        <td align=\'center\' width=\'25%\'>\r\n                                            <table border=\'0\' cellpadding=\'0\' cellspacing=\'0\'>\r\n                                                <tr>\r\n                                                    <td align=\'center\' style=\'color: #000000; font-family: Arial, sans-serif; font-size: 12px; font-weight: bold;\'>Powered by</td>\r\n                                                </tr>\r\n                                                <tr>\r\n                                                    <td align=\'center\' style=\'font-family: Arial, sans-serif; font-size: 12px; font-weight: bold;\'> <a href=\'http://inventure.org/\' style=\'color: #000000;\'>\r\n                                                                    <img src=\'http://safari.inventure.org/assets/images/inventure_black.png\' alt=\'InVenture\' width=\'100\' height=\'40\' style=\'display: block;\' border=\'0\' />\r\n                                                                </a>\r\n\r\n                                                    </td>\r\n                                                </tr>\r\n                                            </table>\r\n                                        </td>\r\n                                        <td style=\'color: #000000; font-family: Arial, sans-serif; font-size: 14px;\' width=\'50%\'></td>\r\n                                        <td style=\'color: #000000; font-family: Arial, sans-serif; font-size: 12px;\' width=\'25%\'>Contact Us:\r\n                                            <br>mkopo@inventure.org\r\n                                            <br>Nairobi, Kenya\r\n                                            <br>\r\n                                        </td>\r\n                                    </tr>\r\n                                </table>\r\n                            </td>\r\n                        </tr>\r\n                    </table>\r\n                </td>\r\n            </tr>\r\n        </table>\r\n    </body>\r\n\r\n</html>','{\"message_type\":\"html\"}','2015-02-04 17:19:23',NULL,4106),(9,'REMINDER: loan due today','Old - Do Not Use','facebook','','','Hi {first_name}, your loan payment is due today. Please send {amount}ksh to MPesa number 0706929088.',NULL,'2014-11-13 16:03:02',NULL,437),(10,'REMINDER: loan due tomorrow','Old - Do Not Use','facebook','','','Hi {first_name}, just a friendly reminder that you have a loan payment due tomorrow, {due_date}. Please send {amount}ksh to MPesa number 0706929088.',NULL,'2014-11-13 16:03:27',NULL,429),(11,'REMINDER: loan due in 3 days','Old - Do Not Use','facebook','','','Hi {first_name}, your next repayment of at least {amount}ksh is due {due_date}. The sooner you repay this loan, the quicker you can get another!',NULL,'2014-11-13 16:04:07',NULL,488),(12,'REMINDER: loan past-due','Old - Do Not Use','facebook','','','Hi {first_name}, you missed your loan payment that was due {due_date}. Please send {amount}ksh to MPesa number 0706929088 to avoid going into default.',NULL,'2014-11-13 16:04:14',NULL,4467),(13,'REMINDER: loan due today','Communication to borrower - Mkopo Rahisi','sms','','','Hi {first_name}, your Mkopo Rahisi loan payment is due today. Please send {amount}ksh to Pay Bill 851900 using your M-Pesa number as your Account number',NULL,'2015-02-05 23:30:46',NULL,10949),(14,'REMINDER: loan due tomorrow','Communication to borrower - Mkopo Rahisi','sms','','','Hi {first_name}, your Mkopo Rahisi payment is due tomorrow, {due_date}. Please send {amount}ksh to MPesa Pay Bill 851900 using your MPesa number. Thanks, Lucy',NULL,'2015-02-04 05:00:18',NULL,11909),(15,'REMINDER: loan due in 3 days','Communication to borrower - Mkopo Rahisi','sms','','','Hi {first_name}, your next repayment of at least {amount}ksh is due {due_date}. The sooner you repay this loan, the quicker you can get another! Thanks, Lucy',NULL,'2015-02-04 05:00:19',NULL,12587),(16,'REMINDER: loan past-due','Communication to borrower - Mkopo Rahisi','sms','','','Hi {first_name}, you missed your loan payment on {due_date}. Please send {amount}ksh to Pay Bill no. 851900 using your M-Pesa no. to avoid default. Thanks, Lucy',NULL,'2015-02-05 23:50:02',NULL,139228),(17,'NOTICE: Loan sent','Communication to borrower - Mkopo Rahisi','sms','','','Hi {first_name}, we have sent you a total of {loan_amount}ksh via Mpesa. Your 1st repayment of {repayment_amount}ksh is due {repayment_frequency}.',NULL,'2015-02-17 17:44:35',NULL,4913),(18,'NOTICE: repayment received','Communication to borrower - Mkopo Rahisi','sms','','','Hi {first_name}, we have received your payment of {repayment_amount}ksh. Your outstanding loan balance is {still_owed}ksh. Thank you for being a valued client of Mkopo Rahisi.',NULL,'2015-02-16 18:11:47',NULL,7566),(19,'EDUCATIONAL: check balance and schedule','Communication to borrower - Mkopo Rahisi','sms','','','Want to check your loan balance and upcoming repayment dates? Just open up your Mkopo app anytime to see both!',NULL,'2015-02-05 23:29:17',NULL,5083),(20,'EDUCATIONAL: get another loan','Communication to borrower - Mkopo Rahisi','sms','','','Need another loan? Finish paying back your current loan so you can apply again in the Mkopo Rahisi app.',NULL,'2015-02-05 23:29:16',NULL,5945),(21,'NOTICE: welcome back','Communication to borrower - Mkopo Rahisi','sms','','','Welcome back to Mkopo Rahisi! You should be receiving your loan shortly. Please let your loan officer know if you have any questions: on.fb.me/1nNRMdt',NULL,'2015-02-10 20:02:21',NULL,2573),(22,'NOTICE: welcome','Communication to borrower - Mkopo Rahisi','sms','','','Welcome to Mkopo Rahisi! Check us out on Facebook to learn more about our services: on.fb.me/1nNRMdt',NULL,'2015-02-04 17:19:23',NULL,2336),(23,'REMINDER: confirm loan receipt','Old - Do Not Use','sms','','','Hi {first_name}, your loan was sent on {loan_start}. I am still awaiting confirmation that you received it. Please reply “Yes I received” to this message. - Lucy',NULL,'2014-11-18 02:11:45',NULL,5843),(24,'WARNING: Do Not Unfriend Lucy','Old - Do Not Use','sms','','','IMPORTANT: By unfriending Lucy on Facebook, you are in default and cannot receive more loans. Please send Lucy a new request immediately http://on.fb.me/TRw4Yw',NULL,'2014-11-13 16:06:12',NULL,1266),(25,'NOTICE: Thanks for confirming loan receipt','Old - Do Not Use','sms','','','Thanks for confirming receipt. Look forward to continuing to work with you as a valued client! - Lucy',NULL,'2014-11-13 16:06:19',NULL,2084),(26,'REMINDER: loan past-due weekly sms','Communication to borrower - Mkopo Rahisi','sms','','','Hi {first_name}, you have {amount}ksh past due on your Mkopo Rahisi loan. Send payment to MPesa Pay Bill number 851900 to remain part of Mkopo Rahisi',NULL,'2015-02-04 05:00:11',NULL,3961),(27,'NOTICE: Partial loan sent SMS','Communication to borrower - Mkopo Rahisi','sms','','','Hi {first_name}, we sent a small part of your loan via MPesa. Pls message us on facebook how much you received: on.fb.me/1nNRMdt - then we’ll send the rest.',NULL,'2015-02-17 17:42:10',NULL,1133),(28,'NOTICE: Confirm Initial Amount','Communication to borrower - Mkopo Rahisi','sms','','','Thanks for confirming you received the loan, you should get the rest shortly. Like our page on facebook for important updates from Mkopo Rahisi: on.fb.me/1nNRMdt',NULL,'2015-02-17 17:44:26',NULL,1114),(29,'Delayed Credit Decision: Accepted','Communication to borrower - Mkopo Rahisi','sms','','','Your application for a loan from Mkopo Rahisi has been approved! Please check the app for details.',NULL,'2015-02-10 14:52:20',NULL,1),(30,'Delayed Credit Decision: Rejected','Communication to borrower - Mkopo Rahisi','sms','','','Your decision on your loan application from Mkopo Rahisi is now available. Please check the app for more information',NULL,'2015-02-17 16:50:15',NULL,2),(31,'NOTICE: Waitlisted User Manually Allowed','Communication to borrower - Mkopo Rahisi','sms','','','Hi {fname}, great news! You are now able to apply for an Mkopo Rahisi loan. Just open the app to get started. Thank you for your patience!',NULL,'2015-02-16 17:17:09',NULL,1);
