INSERT INTO `smsregex` VALUES (997,'MPESA','loanRejection','Confirmed. You already have a loan and do (.*) for a second. Your current loan balance is Ksh(.*) and','{\"1\":{\"loan_approved\":{\"not qualify\":0}},\"2\":\"loan_outstanding_balance\"}','ET84PS869 Confirmed. You already have a loan and do not qualify for a second. Your current loan balance is Ksh1,290.00 and is due on 28/03/2014.','0000-00-00 00:00:00'),(998,'MPESA','loanRejection','Confirmed\\. You do (.*) for a loan','{\"1\":{\"loan_approved\":{\"not qualify\":0}}}','EY22DJ854 Confirmed. You do not qualify for a loan. Keep using M-PESA and M-Shwari products to qualify.','0000-00-00 00:00:00'),(999,'MPESA','loanRejection','(.*): You have an outstanding loan of Ksh(.*)\\. Please repay first and then request loan.','{\"1\":{\"loan_approved\":{\"Failed\":0}},\"2\":\"loan_outstanding_balance\"}','Failed: You have an outstanding loan of Ksh792.21. Please repay first and then request loan.','0000-00-00 00:00:00'),(1000,'MPESA','loanRejection','Your loan request was (.*) because the amount was higher than your maximum limit, you currently qualify for Ksh(.*)','{\"1\":{\"loan_approved\":{\"declined\":0}},\"2\":\"cur_loan_limit\"}','Your loan request was declined because the amount was higher than your maximum limit, you currently qualify for Ksh3,000.00','0000-00-00 00:00:00'),(1002,'AFB','loanApproval','Congratulations, your afb Retail Credit Card is (.*)! To collect your card take your one time pin','{\"1\":{\"loan_approved\":{\"approved\":1}}}','Congratulations, your afb Retail Credit Card is approved! To collect your card take your one time pin 417912 to the store where you applied. For queries call 0203626000','0000-00-00 00:00:00'),(1003,'MPESA','loanApproval','confirmed. Loan request at (.*) is (.*). New M-PESA balance is Ksh(.*). Your loan of Ksh(.*) is due on (.*)\\.','{\"2\":{\"loan_approved\":{\"approved\":1}},\"4\":\"loan_outstanding_balance\"}','EV40KZ443 confirmed. Loan request at M-Shwari is appro